O escapamento Gemoto foi projetado com tecnologia de primeira linha, este modelo oferece mais ganho de fluxo na exaustão e garante respostas mais rápidas a sua motocicleta, além de oferecer um ronco único acordo com as normas regulamentadoras de fabricação.

Aplicação:

- Titan 160 2016;
- Titan 160 2017;
- Titan 160 2018;
- Titan 160 2019;
- Titan 160 2020;
- Titan 160 2021;
- Titan 160 2022;

- Fan 160 2018;
- Fan 160 2019;
- Fan 160 2020;
- Fan 160 2021;
- Fan 160 2022;

Dicas:

- A instalação deve ser feita por um profissional especializado. A nossa loja não se responsabiliza por instalação mal realizada;

- O produto é pronto para instalação de acordo com o modelo da moto, e encaixa-se perfeitamente no lugar do original, não sendo necessário nenhum tipo de adaptação.
